use crate::traits::{Serialize, Deserialize};

global BOOL_SERIALIZED_LEN: Field = 1;
global U8_SERIALIZED_LEN: Field = 1;
global U32_SERIALIZED_LEN: Field = 1;
global U64_SERIALIZED_LEN: Field = 1;
